import Link from "next/link"

const Navbar = () => (
  <nav className="navbar navbar-expand navbar-dark bg-dark">
    <Link to="/" className="navbar-brand"><i className="fas fa-cocktail fa-2x"></i> COCKTAILS</Link>
  </nav>
);

export default Navbar;
